import React from 'react';
import './footer.css';
import {Container, Row, Col, ListGroup, ListGroupItem} from 'reactstrap';
import {Link} from 'react-router-dom'; 
import logo from '../../assets/images/logo.png';

const quick__links = [
  {
    Path: '/home',
    display: 'Home'
  },
  {
    Path: '/about',
    display: 'About'
  },
  {
    Path: '/tours',
    display: 'Tours'
  },
]

const quick__links2 = [
  {
    Path: '/gallery',
    display: 'Gallery'
  },
  {
    Path: '/login',
    display: 'Login'
  },
  {
    Path: '/register',
    display: 'Register'
  },
]

const Footer = () => {
  return  
  <Container>
    <Row>
      <Col lg='3'>
        <div className="logo">
          <img src={logo} alt="" />
          <p>Explore the best travel adventures with us worldwide.</p>

          <div className="social__links d-flex align-items-center gap-4">
            <span>
              <Link to='https://github.com/Vijay263601'><i class="ri-github-fill"></i></Link>
            </span>
            <span>
              <Link to='https://codepen.io/Vijay263601'><i class="ri-codepen-fill"></i></Link>
            </span>
            <span>
              <Link to='https://discord.gg/bCpaU6MQJN'><i class="ri-discord-fill"></i></Link>
            </span>
            <span>
              <Link to='https://www.linkedin.com/in/vijay-singh-majila-252429160/'><i class="ri-linkedin-box-fill"></i></Link>
            </span>
            <span>
              <Link to='https://instagram.com/vijaymajila'><i class="ri-instagram-line"></i></Link>
            </span>
          </div>
        </div>
      </Col>

      <Col lg='3'>
        <div className="footer__link-title">Discover</div>

        <ListGroup className="footer__quick-links">
          {
            quick__links.map((item,index)=>(
              <ListGroupItem key={index} className='ps-0 border-' >
                <Link to={item.Path}>{item.display}</Link>
              </ListGroupItem>
            ))
          }
        </ListGroup>
       </Col>
      <Col lg='3'></Col>
      <Col lg='3'></Col>
    </Row>
  </Container>

}

export default Footer
